  false,\n\t\"url\": null,\n\t\"notes\": \"Austin Resource Recovery daily report providing
  waste collection information based on the following categories:rnReport Date: The
  date collections information was recorded.rnLoad Type: The specific type of load
  that is being collected on that day. rnLoad Weight: The weight (in pounds) collected
  for each service on the day it was delivered to a diversion facilityrnDrop off Site:
  The location where each type of waste is delivered for disposal, recycling or reuse:
  TDS Landfill indicates the Texas Disposal System landfill located at 12200 Carl
  Rd, Creedmoor, TX 78610; Balcones Recycling is a recycling facility located at  9301
  Johnny Morris Road Austin, TX 78724; MRF is a Materials Recycling Facility (such
  as Texas Disposal Systems or Balcones Recycling);  Hornsby Bend is located at 2210
  FM 973, Austin, TX 78725  and accepts food scraps, yard trimmings, food-soiled paper
  and other materials collected by ARR, and combined with other waste to produce nutrient-rich
  dillo dirt,  used for landscaping.rnRoute Type:  The general category of collection
  service provided by Austin Resource Recovery rnThis information is used to help
  ARR reach its goals to transform waste into resources while keeping our community
  clean. For more information, visit www.austintexas.gov/department/austin-resource-recovery\",\n\t\"license_title\":
